import { Box, Button } from "@mui/material";
import React, { Component } from "react";

class Buttons extends Component {
  render() {
    return (
      <Button
        sx={{
          display: "flex",
          flexDirection: "row",
          alignItems: "center",
          padding: "0px",
          position: "absolute",
          left: "21.15%",
          right: "20.77%",
          top: "36.22%",
          bottom: "36.22%",
        }}
      >
        button
      </Button>
    );
  }
}

export default Buttons;
